import React from 'react';

const Adress = (props) => {
    return (
        <div className='Adress'>
            <h3>{props.user.name}</h3>
            <h3>{props.user.street}</h3>
            <h3>{props.user.zip}</h3>
            <h3>{props.user.city}</h3>
            <h3>{props.user.country}</h3>
        </div>
    );
};

export default Adress;
